import express from "express";
import routes from "./routers";
import dotenv from "dotenv";
dotenv.config();

const app = express();
const PORT = 3000;

app.use(express.json());
app.use(routes);

const server = app.listen(PORT, console.log(`Server Listening on ${PORT} `));

// Handle unhandled promise rejections
process.on("unhandledRejection", (err, promise) => {
  // close server & exit process
  server.close(() => process.exit(1));
});

export default app;

import express from "express";
import carRoutes from "./car.routes";

const routes = express();

routes.get("/", (req, res) => {
  return res.status(200).json({
    message: "This car QR-code generator",
  });
});

routes.use("/api/v1/cars", carRoutes);

routes.get("*", (req, res) => {
  res.status(404).json({
    message: "Page not found, try again",
  });
});

export default routes;

import express from "express";
import carQRCodeController from "../controllers/car.controllers";
import { carValidation } from "../validations/car.validations";

const routes = express();

routes.post("/", carValidation, carQRCodeController.createQRCode);

export default routes;

import QRCode from "qrcode";

export class GenerateCarQRCodeControllers {
  async createQRCode(req, res) {
    try {
      const { driver_name, car_plate, phone_number } = req.body;
      let stringData = JSON.stringify({ driver_name, car_plate, phone_number });
      QRCode.toString(stringData, { type: "terminal" }, (err, QRcode) => {
        if (err) return console.log("error occurred");
        console.log(QRcode);
      });
      QRCode.toDataURL(stringData, (err, code) => {
        if (err) return console.log(err);
        return res.status(201).json({
          message:"QRCode generated successfully",
          code,
        });
      });
    } catch (err) {
      return res.status(500).json({
        message: "Error while generating QRCode,try again",
        error: err.message,
      });
    }
  }
}

const carQRCodeController = new GenerateCarQRCodeControllers();
export default carQRCodeController;

import joi from "joi";
export const carValidation = async (req, res, next) => {
  const carSchema = joi.object({
    driver_name: joi.string().required().messages({
      "any.required": "Driver names are required",
    }),
    car_plate: joi.string().required().messages({
      "any.required": "Car plate number are required",
    }),
    phone_number: joi.string().required().messages({
      "any.required": "Drive phone number is required",
    }),
  });
  const value = await carSchema.validate(req.body);
  if (value.error) {
    res.status(400).json({
      message: value.error.details[0].message.replace(/["'`]+/g, ""),
    });
  } else {
    next();
  }
};
